import { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 85%;
  margin: 0px auto 100px;
`;
const Box = styled.div``;


const Form = styled.form`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
`;
const Input = styled.input`
  flex: 1;
  margin: 20px 10px 0px 0px;
  padding: 10px;
  font-size: 1.1rem;
`;
const Button = styled.button`
  width: 40%;
  border: none;
  padding: 12px 20px;
  background-color: #2879fe;
  color: white;
  cursor: pointer;
  &:disabled {
    cursor: not-allowed;
    background-color: grey;
  }
`;
const Error = styled.span`
  color: red;
  margin: 8px;
`;
const Text = styled.div`
  margin: 5px 20px;
  font-size:44px;
  text-decoration: underline;
  cursor: pointer;
`;
const Agreement = styled.span`
  font-size: 14px;
  margin: 20px 0px;
`;
const ImgHolder=styled.div`
  display: flex;
  justify-content: center;
  align-items:center;
`
const Img=styled.img`
  width: 180px;
  height: 180px;
  object-fit: cover;
  border-radius: 50%;
`
const Home = () => {
  const [auth, setAuth] = useState(false);
  const handleInput = () => {};
  const handleSubmit = () => {};
  return (
    <Wrapper>
        <h1>Fill the Application</h1>
        <Box>
    <ImgHolder>
        <Img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR8jHWqdlzhWF9BkKJeGpw2nHlImVzgnL2blQMl77LPpcbNbmAPdLKo2wXWXrXrWx4Tnio&usqp=CAU" alt="your picture" />
    </ImgHolder>
        </Box>
        <Form>
          <Input
            onChange={handleInput}
            name="first_name"
            placeholder="First Name"
            type="text"
          />
          <Input
            onChange={handleInput}
            name="last_name"
            placeholder="Last Name"
            type="text"
          />
          <Input
            onChange={handleInput}
            name="email"
            placeholder="email"
            type="email"
          />
          <Input
            onChange={handleInput}
            name="password"
            placeholder="password"
            type="password"
          />
          <Input
            onChange={handleInput}
            name="dob"
            placeholder="DOB (date of birth)"
            type="date"
          />
          <Box>
            Choose your picture
            <Input onChange={handleInput} name="dob" type="file" />
          </Box>
          <Box>
            Choose your picture
            <Input onChange={handleInput} name="dob" type="file" />
          </Box>
          <Agreement>
            By creating an account, I consent to the processing of my personal
            data in accordance with the <b>PRIVACY POLICY</b>
          </Agreement>
          <Button disabled={auth.isLoading} onClick={handleSubmit}>
            SUBMIT
          </Button>

            <Link to="/signup">
          <Text>
              ALREADY Filled the application?
          </Text>
            </Link>
          {auth.isFailure && <Error>{auth.message}</Error>}
        </Form>

    </Wrapper>
  );
};

export default Home;
